import { React } from "react";
import { useSelector } from "react-redux";

const Profile = () => {
  const user = useSelector((state) => {
    state.user.value;
  });
  return (
    <div>
      <h1>Profile page</h1>
      <p>Name:{user.name}</p>
      <p>Height:{user.height}</p>
      <p>Age:{user.age}</p>
    </div>
  );
};
const Login = () => {
  return <button>Login</button>;
};

export const ReduxPractice = () => {
  return (
    <div>
      <Profile />
      <Login />
    </div>
  );
};
